import React from 'react'
import Table from '../../Components/Table/Table'

type Props = {}

const DesignPage = (props: Props) => {
  return (
    <>
      <h1>Страница шаблона дизайна</h1>
      <h2>
        Страница на котором отображается шаблон дизайна
      </h2>
      <Table data={[{ cik: '1', year: 2023, income: 150000 }, { cik: '2', year: 2022, income: 120000 }]}/>
    </>
  )
}

export default DesignPage
